import React, { useEffect, useState } from "react";
import Box from "@mui/material/Box";
import { DataGrid, GridColDef } from "@mui/x-data-grid";
import { IStudentDetail } from "../types/api_types";

interface TestProps {
  studentDetails: IStudentDetail[][];
  classTitleId: string[];
}

const columns: GridColDef[] = [
  {
    field: "studentID",
    headerName: "Student ID",
  },
  {
    field: "studentName",
    headerName: "Student Name",
    width: 150,
  },
  {
    field: "classID",
    headerName: "Class ID",
  },
  {
    field: "className",
    headerName: "Class Name",
  },
  {
    field: "semester",
    headerName: "Semester",
  },
  {
    field: "finalGrade",
    headerName: "Final Grade",
  },
];

export const Test = ({ studentDetails, classTitleId }: TestProps) => {
  console.log(studentDetails[0][0]);
  const classTitle = classTitleId[0];
  const classId = classTitleId[1];

  const rows = studentDetails.map((studentArray, index) => {
    const student = studentArray[0].name;
    //console.log(student);
    return {
      id: index,
      studentID: "a",
      studentName: "a",
      classID: classId,
      className: classTitle,
      semester: "fall2022",
      finalGrade: "Unknown",
    };
  });
  return (
    <Box sx={{ height: 400, width: "100%" }}>
      <DataGrid rows={rows} columns={columns} pageSize={10} />
    </Box>
  );
};
